import React from "react";
import ".SobreSistema.css"; // Importe o arquivo CSS

const SobreSistema: React.FC = () => {
  return (
    <section className="sobre-sistema">
      <div className="texto">
        <h2>Sobre Nosso Sistema</h2>
        <p>
          O sistema da iClinic é projetado para oferecer uma experiência
          eficiente e integrada para a gestão de clínicas médicas. Nossa
          plataforma facilita o agendamento de consultas, o acesso a prontuários
          digitais, a administração de profissionais de saúde e muito mais.
        </p>
      </div>

      <div className="imagens">
        {/* Adicione imagens ou use placeholders */}
        <img src="url_da_imagem_1" alt="Imagem 1" />
        <img src="url_da_imagem_2" alt="Imagem 2" />
      </div>
    </section>
  );
};

export default SobreSistema;
